import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import './HeartbeatMonitor.css';

const HeartbeatMonitor = () => {
  const [heartbeat, setHeartbeat] = useState(0);
  const [isBeating, setIsBeating] = useState(false);

  useEffect(() => {
    // Simulate heartbeat
    const interval = setInterval(() => {
      setHeartbeat(prev => {
        const newBeat = prev + 1;
        if (newBeat > 100) {
          setHeartbeat(0);
          return 0;
        }
        return newBeat;
      });
      
      // Trigger beat animation
      setIsBeating(true);
      setTimeout(() => setIsBeating(false), 200);
    }, 1000);

    return () => clearInterval(interval);
  }, []);

  return (
    <motion.div 
      className="heartbeat-monitor"
      initial={{ opacity: 0, scale: 0.8 }}
      animate={{ opacity: 1, scale: 1 }}
      transition={{ duration: 0.8, delay: 1.5, type: "spring" }}
    >
      {/* Main heartbeat display */}
      <div className="heartbeat-container">
        {/* Background glow */}
        <motion.div
          className="heartbeat-glow"
          animate={{
            opacity: [0.3, 0.6, 0.3],
            scale: [0.95, 1.05, 0.95]
          }}
          transition={{
            duration: 2,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />
        
        {/* Main heart icon */}
        <motion.div
          className="main-heart"
          animate={isBeating ? {
            scale: [1, 1.4, 1],
            rotate: [0, 5, -5, 0]
          } : {
            scale: [1, 1.1, 1],
            rotate: [0, 2, -2, 0]
          }}
          transition={{
            duration: isBeating ? 0.3 : 2,
            ease: "easeInOut"
          }}
        >
          ‚ù§Ô∏è
        </motion.div>

        {/* Heartbeat line */}
        <div className="heartbeat-line">
          <motion.div
            className="beat-wave"
            animate={{
              scaleX: [0, 1, 0],
              opacity: [0, 1, 0]
            }}
            transition={{
              duration: 1,
              repeat: Infinity,
              ease: "easeInOut"
            }}
          />
          <motion.div
            className="beat-wave"
            animate={{
              scaleX: [0, 1, 0],
              opacity: [0, 1, 0]
            }}
            transition={{
              duration: 1,
              repeat: Infinity,
              delay: 0.5,
              ease: "easeInOut"
            }}
          />
        </div>

        {/* Heartbeat stats */}
        <div className="heartbeat-stats">
          <motion.div
            className="stat-item"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 2, duration: 0.6 }}
          >
            <span className="stat-label">üíì Heartbeat</span>
            <span className="stat-value">{heartbeat} BPM</span>
          </motion.div>
          
          <motion.div
            className="stat-item"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 2.2, duration: 0.6 }}
          >
            <span className="stat-label">üíï Love Level</span>
            <span className="stat-value">‚àû%</span>
          </motion.div>
        </div>

        {/* Floating mini hearts */}
        {[...Array(5)].map((_, i) => (
          <motion.div
            key={i}
            className="floating-mini-heart"
            initial={{ 
              opacity: 0,
              scale: 0,
              x: 0,
              y: 0
            }}
            animate={{ 
              opacity: [0, 1, 0],
              scale: [0, 1, 0],
              x: Math.cos(i * 72 * Math.PI / 180) * 60,
              y: Math.sin(i * 72 * Math.PI / 180) * 60
            }}
            transition={{
              duration: 3,
              repeat: Infinity,
              delay: i * 0.6,
              ease: "easeInOut"
            }}
          >
            {['üíñ', 'üíï', 'üíó', 'üíì', 'üíò'][i]}
          </motion.div>
        ))}
      </div>

      {/* Decorative elements */}
      <motion.div
        className="decorative-sparkles"
        animate={{
          rotate: 360
        }}
        transition={{
          duration: 30,
          repeat: Infinity,
          ease: "linear"
        }}
      >
        {[...Array(4)].map((_, i) => (
          <motion.div
            key={`sparkle-${i}`}
            className="sparkle"
            animate={{
              opacity: [0.3, 1, 0.3],
              scale: [0.8, 1.2, 0.8]
            }}
            transition={{
              duration: 4,
              repeat: Infinity,
              delay: i * 1,
              ease: "easeInOut"
            }}
          >
            {['‚ú®', 'üí´', '‚≠ê', 'üåü'][i]}
          </motion.div>
        ))}
      </motion.div>
    </motion.div>
  );
};

export default HeartbeatMonitor;
